  `goods_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品名称',
  `goods_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '商品价格',
  `goods_number` int(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品数量',
  `goods_weight` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '商品重量',
  `cat_id` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT '类型id',
  `goods_introduce` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商品详情介绍',
  `goods_big_logo` char(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '图片logo大图',
  `goods_small_logo` char(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '图片logo小图',
  `is_deleted` enum('0','1') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '0:正常  1:删除',
  `gmt_create` datetime(0) NOT NULL COMMENT '添加商品时间',
  `gmt_modified` datetime(0) NOT NULL COMMENT '修改商品时间',
  `delete_time` datetime(0) NULL DEFAULT NULL COMMENT '软删除标志字段',
  `cat_one_id` smallint(5) NULL DEFAULT 0 COMMENT '一级分类id',
  `cat_two_id` smallint(5) NULL DEFAULT 0 COMMENT '二级分类id',
  `cat_three_id` smallint(5) NULL DEFAULT 0 COMMENT '三级分类id',
  `hot_mumber` int(11) UNSIGNED NULL DEFAULT 0 COMMENT '热卖数量',
  `is_promote` smallint(5) NULL DEFAULT 0 COMMENT '是否促销',
  `goods_state` int(11) NULL DEFAULT 0 COMMENT '商品状态 0: 未通过 1: 已审核',
  `create_user` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建者',
  `backup` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '备注',
  `is_banner` int(2) NULL DEFAULT 0 COMMENT '是否为banner图',
  `banner_pic` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'banner图',
  `is_slide` int(2) NULL DEFAULT 0 COMMENT '是否为轮播图',
  `slide_pic` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '轮播图',
  `video_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '宣传视频',
  `sub_title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '副标题',
  `is_ads` int(2) NULL DEFAULT 0 COMMENT '是否参加广告',
  `ads_pic` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '广告图',
  `status` int(2) NULL DEFAULT NULL COMMENT '0下架 1上架',
  PRIMARY KEY (`goods_id`) USING BTREE,
  UNIQUE INDEX `goods_name`(`goods_name`) USING BTREE,
  INDEX `goods_price`(`goods_price`) USING BTREE,
  INDEX `add_time`(`gmt_create`) USING BTREE,
  INDEX `goods_name_2`(`goods_name`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 941 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品表' ROW_FORMAT = Dynamic;

