  `pay_status` enum('0','1') CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '订单状态： 0未付款、1已付款',
  `gmt_create` datetime(0) NULL DEFAULT NULL COMMENT '记录生成时间',
  `gmt_modified` datetime(0) NULL DEFAULT NULL COMMENT '记录修改时间',
  `is_deleted` tinyint(2) NULL DEFAULT 0,
  `version` tinyint(4) NOT NULL DEFAULT 0,
  PRIMARY KEY (`order_id`) USING BTREE,
  UNIQUE INDEX `order_number`(`order_number`) USING BTREE,
  INDEX `add_time`(`gmt_create`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 76 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '订单表' ROW_FORMAT = Dynamic;

