INSERT INTO `shs_front_forum` VALUES (1, 'java生成分布式Key', '<p>分布式全局ID生成器作为分布式架构中重要的组成部分，在高并发场景下承载着分担数据库写瓶颈的压力。</p><p>之前实现过PHP+Swoole版，性能和稳定性在生产环境下运行良好。这次使用Java进行重写，目前测试情况表现还不错，下面我简要介绍下java版的项目情况。</p><p>&nbsp;</p><p><strong>技术架构：</strong>Netty + Zookeeper + Redis Protocol</p><ul><li>Netty：是一个基于NIO的客户、服务端编程框架(类似于swoole)。使用netty作为服务端应用接收客户端请求，对Redis协议数据进行编解码，响应redis客户端请求。</li><li>Zookeeper：主要两个作用。一是生成器服务每个节点需预先定义唯一serverId，并注册到zk，由zk统一管理集群节点连接状态；二是自增序列sequenceId可交由zk管理，集群中的自增序列在毫秒级内共用一个值，不过这涉及到共享锁的资源竞争和网络传输，性能很差，默认没开启，下面有具体的压测情况。</li></ul><p><br></p>', '技术', 'lzj', 0, 1, '2020-03-14 13:03:20');
INSERT INTO `shs_front_forum` VALUES (2, 'java 分布式锁', '<h2>### 什么是锁？</h2><ul><li>在单进程的系统中，当存在多个线程可以同时改变某个变量（可变共享变量）时，就需要对变量或代码块做同步，使其在修改这种变量时能够线性执行消除并发修改变量。</li><li>而同步的本质是通过锁来实现的。为了实现多个线程在一个时刻同一个代码块只能有一个线程可执行，那么需要在某个地方做个标记，这个标记必须每个线程都能看到，当标记不存在时可以设置该标记，其余后续线程发现已经有标记了则等待拥有标记的线程结束同步代码块取消标记后再去尝试设置标记。这个标记可以理解为锁。</li><li>不同地方实现锁的方式也不一样，只要能满足所有线程都能看得到标记即可。如 Java 中 synchronize 是在对象头设置标记，Lock 接口的实现类基本上都只是某一个 volitile 修饰的 int 型变量其保证每个线程都能拥有对该 int 的可见性和原子修改，linux 内核中也是利用互斥量或信号量等内存数据做标记。</li><li>除了利用内存数据做锁其实任何互斥的都能做锁（只考虑互斥情况），如流水表中流水号与时间结合做幂等校验可以看作是一个不会释放的锁，或者使用某个文件是否存在作为锁等。只需要满足在对标记进行修改能保证原子性和内存可见性即可。</li></ul><h2>### 什么是分布式？</h2><p>分布式的 CAP 理论告诉我们:</p><blockquote>任何一个分布式系统都无法同时满足一致性（Consistency）、可用性（Availability）和分区容错性（Partition tolerance），最多只能同时满足两项。</blockquote><p>目前很多大型网站及应用都是分布式部署的，分布式场景中的数据一致性问题一直是一个比较重要的话题。基于 CAP理论，很多系统在设计之初就要对这三者做出取舍。在互联网领域的绝大多数的场景中，都需要牺牲强一致性来换取系统的高可用性，系统往往只需要保证最终一致性</p>', '娱乐', 'lzj', 0, 1, '2020-03-14 16:03:37');
INSERT INTO `shs_front_forum` VALUES (3, 'Vue MVVC框架', '<p><strong style=\"color: rgb(51, 51, 51);\">Mvvm定义</strong><span style=\"color: rgb(51, 51, 51);\">MVVM是Model-View-ViewModel的简写。即模型-视图-视图模型。【模型】指的是后端传递的数据。【视图】指的是所看到的页面。【视图模型】mvvm模式的核心，它是连接view和model的桥梁。它有两个方向：一是将【模型】转化成【视图】，即将后端传递的数据转化成所看到的页面。实现的方式是：数据绑定。二是将【视图】转化成【模型】，即将所看到的页面转化成后端的数据。实现的方式是：DOM 事件监听。这两个方向都实现的，我们称之为数据的双向绑定。总结：在MVVM的框架下视图和模型是不能直接通信的。它们通过ViewModel来通信，ViewModel通常要实现一个observer观察者，当数据发生变化，ViewModel能够监听到数据的这种变化，然后通知到对应的视图做自动更新，而当用户操作视图，ViewModel也能监听到视图的变化，然后通知数据做改动，这实际上就实现了数据的双向绑定。并且MVVM中的View 和 ViewModel可以互相通信</span></p>', '技术', 'lzj', 0, 1, '2020-03-15 11:03:45');
INSERT INTO `shs_front_forum` VALUES (4, 'ElementUI 饿了么前端框架', '<h2>引入Element</h2><p>因为整个项目是依赖ElementUI框架做的，所以采用了全部引入</p><p>1，在项目根目录执行命令：npm i element-ui -S进行安装</p><p>2，在main.js中引入element：</p><div></div><p>3，在组件中直接使用</p><h2>修改主题色</h2><p>1，安装sass：</p><p>npm install node-sass --save-dev&nbsp;</p><p>npm install sass-loader --save-dev</p>', '技术', 'lzj', 0, 1, '2020-03-15 13:03:53');
INSERT INTO `shs_front_forum` VALUES (5, 'axios 完成ajax请求', '<p>基于promise用于浏览器和node.js的http客户端</p><h2>特点</h2><ul><li>支持浏览器和node.js</li><li>支持promise</li><li>能拦截请求和响应</li><li>能转换请求和响应数据</li><li>能取消请求</li><li>自动转换JSON数据</li><li>浏览器端支持防止CSRF(跨站请求伪造)</li></ul><p><br></p><p><br></p><p>作者：cool_cl</p><p>链接：https://www.jianshu.com/p/7a9fbcbb1114</p><p>来源：简书</p><p>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</p>', '技术', 'lzj', 0, 6, '2020-03-15 13:06:13');
