INSERT INTO `shs_front_replay` VALUES (5, 'lzj', 5, '<p>基于promise用于浏览器和node.js的http客户端</p><h2>特点</h2><ul><li>支持浏览器和node.js</li><li>支持promise</li><li>能拦截请求和响应</li><li>能转换请求和响应数据</li><li>能取消请求</li><li>自动转换JSON数据</li><li>浏览器端支持防止CSRF(跨站请求伪造)</li></ul><p><br></p><p><br></p><p>作者：cool_cl</p><p>链接：https://www.jianshu.com/p/7a9fbcbb1114</p><p>来源：简书</p><p>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</p>', 1, 0, '[]', '2020-03-15 13:06:14');
INSERT INTO `shs_front_replay` VALUES (6, 'hzk', 5, '请求方法别名\n为了方便我们为所有支持的请求方法均提供了别名。\n\naxios.request(config)\naxios.get(url[, config])\naxios.delete(url[, config])\naxios.head(url[, config])\naxios.options(url[, config])\naxios.post(url[, data[, config]])\naxios.put(url[, data[, config]])\naxios.patch(url[, data[, config]])\n注释\n当使用以上别名方法时，url，method和data等属性不用在config重复声明。\n\n同时发生的请求\n一下两个用来处理同时发生多个请求的辅助函数\n\naxios.all(iterable)\naxios.spread(callback)\n创建一个实例\n你可以创建一个拥有通用配置的axios实例\n\naxios.creat([config])\n\n作者：cool_cl\n链接：https://www.jianshu.com/p/7a9fbcbb1114\n来源：简书\n著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。', 2, 0, '[]', '2020-03-15 13:11:07');
INSERT INTO `shs_front_replay` VALUES (7, 'hzk', 5, 'var instance = axios.create({\r\n  baseURL: \'https://some-domain.com/api/\',\r\n  timeout: 1000,\r\n  headers: {\'X-Custom-Header\': \'foobar\'}\r\n});', 3, 0, '[]', '2020-03-15 13:13:59');
INSERT INTO `shs_front_replay` VALUES (8, 'hzk', 5, '请求配置\n下面是所有可用的请求配置项，只有url是必填，默认的请求方法是GET，如果没有指定请求方法的话\n{\n  // `url` 是请求的接口地址\n  url: \'/user\',\n\n  // `method` 是请求的方法\n  method: \'get\', // 默认值\n\n  // 如果url不是绝对路径，那么会将baseURL和url拼接作为请求的接口地址\n  // 用来区分不同环境，建议使用\n  baseURL: \'https://some-domain.com/api/\',\n\n  // 用于请求之前对请求数据进行操作\n  // 只用当请求方法为‘PUT’，‘POST’和‘PATCH’时可用\n  // 最后一个函数需return出相应数据\n  // 可以修改headers\n  transformRequest: [function (data, headers) {\n    // 可以对data做任何操作\n\n    return data;\n  }],\n\n  // 用于对相应数据进行处理\n  // 它会通过then或者catch\n  transformResponse: [function (data) {\n    // 可以对data做任何操作\n\n    return data;\n  }],\n\n  // `headers` are custom headers to be sent\n  headers: {\'X-Requested-With\': \'XMLHttpRequest\'},\n\n  // URL参数\n  // 必须是一个纯对象或者 URL参数对象\n  params: {\n    ID: 12345\n  },\n\n  // 是一个可选的函数负责序列化`params`\n  // (e.g. https://www.npmjs.com/package/qs, http://api.jquery.com/jquery.param/)\n  paramsSerializer: function(params) {\n    return Qs.stringify(params, {arrayFormat: \'brackets\'})\n  },\n\n  // 请求体数据\n  // 只有当请求方法为\'PUT\', \'POST\',和\'PATCH\'时可用\n  // 当没有设置`transformRequest`时，必须是以下几种格式\n  // - string, plain object, ArrayBuffer, ArrayBufferView, URLSearchParams\n  // - Browser only: FormData, File, Blob\n  // - Node only: Stream, Buffer\n  data: {\n    firstName: \'Fred\'\n  },\n\n  // 请求超时时间（毫秒）\n  timeout: 1000,\n\n  // 是否携带cookie信息\n  withCredentials: false, // default\n\n  // 统一处理request让测试更加容易\n  // 返回一个promise并提供一个可用的response\n  // 其实我并不知道这个是干嘛的！！！！\n  // (see lib/adapters/README.md).\n  adapter: function (config) {\n    /* ... */\n  }\n}', 4, 0, '[]', '2020-03-15 13:18:31');
INSERT INTO `shs_front_replay` VALUES (9, 'hzk', 5, '支持浏览器和node.js\n支持promise\n能拦截请求和响应\n能转换请求和响应数据\n能取消请求\n自动转换JSON数据\n浏览器端支持防止CSRF(跨站请求伪造)', 5, 0, '[]', '2020-03-15 13:20:22');
INSERT INTO `shs_front_replay` VALUES (10, 'hzk', 5, '支持浏览器和node.js\n支持promise\n能拦截请求和响应\n能转换请求和响应数据\n能取消请求\n自动转换JSON数据\n浏览器端支持防止CSRF(跨站请求伪造)', 6, 0, '[]', '2020-03-15 13:20:26');
